import React from 'react';
import Navbar from './components/NavBar'
import './App.css';
import './components/U1'
import { HashRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
		<HashRouter>
			<ScrollToTop/>
			<Navigationbar/>
			<Routes>
				<Route index element = {<HomePage/>}/>
				<Route path='/about' element = {<U1/>}/>
			</Routes>
		</HashRouter>
   	</div>
  );
}

export default App;
